import { useState, useEffect } from "react";
import "../../css/student.css"; // Make sure this path is correct
import "bootstrap/dist/css/bootstrap.min.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faUser } from '@fortawesome/free-solid-svg-icons';

const StudentDashboard = () => {
  const [isNavVisible, setIsNavVisible] = useState(true);
  const [activeLink, setActiveLink] = useState("Dashboard");

  const handleNavToggle = () => {
    setIsNavVisible(!isNavVisible);
  };

  const handleLinkClick = (name) => {
    setActiveLink(name);
  };

  const iconMapping = {
    Dashboard: "bi bi-app-indicator",
    "My Timetable": "bi bi-calendar2",
    Attendance: "bi bi-clipboard-check",
    Payments: "bi bi-credit-card",
    Assignments: "bi bi-file-earmark-text",
    Exams: "bi bi-pencil-square",
  };

  useEffect(() => {
    // You can add code here to handle any side effects if needed
    // For example, initializing libraries or event listeners

    // Cleanup function if needed
    return () => {
      // Cleanup code if necessary
    };
  }, [isNavVisible]); // Dependencies, if any

  return (
    <>
      <section
        id="body-pd"
        className={`body ${isNavVisible ? "body-pd" : ""} bg-light`}
      >
        <header
          className={`header ${isNavVisible ? "body-pd" : ""}`}
          id="header"
        >
          <div className="header_toggle" onClick={handleNavToggle}>
            <i
              className={`bx text-light ${isNavVisible ? "bi bi-list" : "bi bi-x"}`}
              id="header-toggle"
            ></i>
          </div>

          <div className="d-flex">
            <div>
            <i class="bi bi-person-circle fs-2 text-white"></i>
            </div>
            <div className="ps-3 d-flex align-items-center">
              <span className="nav_logo-name text-light">
                Student ID: 22305
              </span>
            </div>
          </div>
        </header>
        <div className={`l-navbar ${isNavVisible ? "show" : ""}`} id="nav-bar">
          <nav className="nav">
            <div>
              <a href="#" className="nav_logo a">
                <i className="bi bi-shop-window nav_logo-icon"></i>
                <span className="nav_logo-name">
                  ACADEMIC <br /> DIVISION
                </span>
              </a>
              <div className="nav_list">
              {[
        "Dashboard",
        "My Timetable",
        "Attendance",
        "Payments",
        "Assignments",
        "Exams",
      ].map((name) => (
        <a
          href="#"
          key={name}
          className={`nav_link ${activeLink === name ? "active" : ""} a`}
          onClick={() => handleLinkClick(name)}
        >
          <i className={`${iconMapping[name]} nav_icon`}></i>
          <span className="nav_name">{name}</span>
        </a>
      ))}
              </div>
            </div>
            <a href="#" className="nav_link a">
              <i className="bx bx-log-out nav_icon"></i>
              <span className="nav_name">SignOut</span>
            </a>
          </nav>
        </div>
        {/* Container Main start */}
        <div className="height-100 pt-4 bg-light">
          <div className="w-100 bg-danger d-flex justify-content-center">
            {/* card */}
            <div class="card">
              <div class="card-body">
                <h5 class="card-title fs-5">Special title treatment</h5>
                <p class="card-text fs-6">
                  With supporting text below as a natural lead-in to additional
                  content.
                </p>
                <a href="#" class="btn btn-primary">
                  Go somewhere
                </a>
              </div>
            </div>
            {/* card */}
            {/* card */}
            <div class="card m-2 card-color">
              <div class="card-body p-3">
                <p class="card-title rounded-5 fs-6 fw-semibold">Special title treatment</p>
                <div className="col-12">
                    <div className="col-6">
                    <p><i class="bi bi-bookmark-check-fill fs-1"></i></p>
                    </div>
                </div>
                
                <p class="card-text">
                  With supporting text below as a natural lead-in to additional
                  content.
                </p>
                <a href="#" class="btn btn-primary">
                  Go somewhere
                </a>
              </div>
            </div>
            {/* card */}
          </div>
        </div>
      </section>
    </>
  );
};

export default StudentDashboard;
